### Problem14

```java
public class Ascending
{
    public static void main (String[]args)
    {
        int x = Integer.parseInt(args[0]);
        int y = Integer.parseInt(args[1]);
        int z = Integer.parseInt(args[2]);
        System.out.println(__0__);
    }
}
```

Complete Ascending.java so that it will take 3 int values from command lines and print 'true' if they are in an ascending order (x<y<z), otherwise, it will print 'false'.

Example:

```
java Ascending 1 2 3 
```

Output:

```
true
```

